config.template:
#gopng_<%=name%>_outer {
height: <%=h%>px;
width: <%=w%>px;
overflow: hidden;
}
#gopng_<%=name%> {
background: url(<%=absolute_path%>) -<%=x%>px -<%=y%>px no-repeat;
width: 100%;
height: 100%;
_background: none;
_padding-left: <%=x%>px;
_margin-left: -<%=x%>px;
_padding-top: <%=y%>px;
_margin-top: -<%=y%>px;
_filter: progid:DXImageTransform.Microsoft.AlphaImageLoader(sizingMethod=crop,src="<%=absolute_path%>");
}
